const RadioTypeQuestion = (props)=>{
  const options =(props)=> {
    return props.questionInfo.options.map(e=> {
      <>
        <input type="radio" value="a" />
        <label for="teen">{e}</label><br/>
      </>
      });
    }

    
  return(
  <>
    <div className = 'questionBody'>
      <h3>{props.questionInfo.id}</h3>
      <h4>{props.questionInfo.question}</h4>
      <form method='get'>
        {options(props)}
      </form>
    </div>
    
  
  </>

  )
}


